import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component{

  constructor(){
    super();

    this.state = [{
                    name: 'Frankenstein'
                  },
                  {
                    name: 'Dracula'
                  },
                  {
                    name: 'Zombie'
                  }]
  }

  render(){
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <p>Test string {this.state.testString} {this.state.testStringB}</p>
          <button onClick={() => this.setState({testStringB: 'the State'})}>Click Me</button>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }
}

export default App;
